import React, { useEffect, useState } from "react";
import {
  useCreateEmptyLegMutation,
  useUpdateEmptyLegMutation,
} from "../../redux/api/emptyLegApi";

import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";
import { useGetBookingsQuery } from "../../redux/api/bookingApi";
import { useGetAirportsQuery } from "../../redux/api/airportApi";

import toast from "react-hot-toast";

const EmptyLegForm = ({ editingLeg, onSuccess }) => {
  const isEdit = Boolean(editingLeg);

  const [form, setForm] = useState({
    bookingId: "",
    flightType: "",
    from: "",
    to: "",
    date: "",
    time: "",
    exactPrice: "",
    offerPrice: "",
  });

  const { data: flightTypes } = useGetFlightTypesQuery();
  const { data: bookings } = useGetBookingsQuery();
  const { data: airports } = useGetAirportsQuery();

  console.log("Bookings data:", bookings);

  const [createLeg] = useCreateEmptyLegMutation();
  const [updateLeg] = useUpdateEmptyLegMutation();

  useEffect(() => {
    if (editingLeg) {
      setForm({
        bookingId: editingLeg.bookingId?._id || "",
        flightType: editingLeg.flightType?._id || "",
        from: editingLeg.from,
        to: editingLeg.to,
        date: editingLeg.date,
        time: editingLeg.time,
        exactPrice: editingLeg.exactPrice,
        offerPrice: editingLeg.offerPrice || "",
      });
    }
  }, [editingLeg]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      if (isEdit) {
        await updateLeg({ id: editingLeg._id, ...form }).unwrap();
        toast.success("Updated successfully");
      } else {
        await createLeg(form).unwrap();
        toast.success("Created successfully");
      }

      onSuccess();
    } catch {
      toast.error("Failed");
    }
  };

  return (
    <form className="card card-body mb-4" onSubmit={handleSubmit}>
      <h5>{isEdit ? "Edit Empty Leg" : "Add Empty Leg"}</h5>

      <div className="row">
        <div className="col-md-6 mb-3">
          <label>Booking</label>
          <select
            className="form-control"
            name="bookingId"
            value={form.bookingId}
            onChange={handleChange}
          >
            <option value="">Select Booking</option>
            {bookings?.bookings?.map((b) => (
              <option value={b._id} key={b._id}>
                {b.bookingCode}
              </option>
            ))}
          </select>
        </div>

        <div className="col-md-6 mb-3">
          <label>Flight Type</label>
          <select
            className="form-control"
            name="flightType"
            value={form.flightType}
            onChange={handleChange}
            required
          >
            <option value="">Select Flight Type</option>
            {flightTypes?.flightTypes?.map((ft) => (
              <option value={ft._id} key={ft._id}>
                {ft.name}
              </option>
            ))}
          </select>
        </div>

        {/* <div className="col-md-6 mb-3">
          <label>From (IATA)</label>
          <input
            type="text"
            className="form-control"
            name="from"
            value={form.from}
            onChange={handleChange}
            required
          />
        </div> */}
        <div className="col-md-6 mb-3">
          <label>From (IATA)</label>
          <select
            className="form-control"
            name="from"
            value={form.from}
            onChange={handleChange}
            required
          >
            <option value="">Select Airport</option>
            {airports?.airports?.map((airport) => (
              <option value={airport.iata} key={airport._id}>
                {airport.iata} - {airport.name}
              </option>
            ))}
          </select>
        </div>

        {/* <div className="col-md-6 mb-3">
          <label>To (IATA)</label>
          <input
            type="text"
            className="form-control"
            name="to"
            value={form.to}
            onChange={handleChange}
            required
          />
        </div> */}

        <div className="col-md-6 mb-3">
          <label>To (IATA)</label>
          <select
            className="form-control"
            name="to"
            value={form.to}
            onChange={handleChange}
            required
          >
            <option value="">Select Airport</option>
            {airports?.airports?.map((airport) => (
              <option value={airport.iata} key={airport._id}>
                {airport.iata} - {airport.name}
              </option>
            ))}
          </select>
        </div>

        <div className="col-md-4 mb-3">
          <label>Date</label>
          <input
            type="date"
            className="form-control"
            name="date"
            value={form.date}
            onChange={handleChange}
            required
          />
        </div>

        <div className="col-md-4 mb-3">
          <label>Time</label>
          <input
            type="time"
            className="form-control"
            name="time"
            value={form.time}
            onChange={handleChange}
            required
          />
        </div>

        <div className="col-md-4 mb-3">
          <label>Exact Price</label>
          <input
            type="number"
            className="form-control"
            name="exactPrice"
            value={form.exactPrice}
            onChange={handleChange}
            required
          />
        </div>

        <div className="col-md-4 mb-3">
          <label>Offer Price</label>
          <input
            type="number"
            className="form-control"
            name="offerPrice"
            value={form.offerPrice}
            onChange={handleChange}
          />
        </div>
      </div>

      <button className="btn btn-success">
        {isEdit ? "Update" : "Create"}
      </button>
    </form>
  );
};

export default EmptyLegForm;
